import React, { Component } from 'react'
import ButtonList from "../components/ButtonList"

class TripStyleFeature extends Component {
  render() {
    return (
      <div className="container">
        <div className="question-container">
          <span>What style of getaway are you looking for? </span>
          <p>Select up to 2</p>
        </div>
        <ButtonList list={["AAA", "AARP", "U.S. Military or Veterans Association", "American Express"]}/>
      </div>
    )
  }
}

export default TripStyleFeature;
